 import axios from "axios"
import React, { useEffect, useState } from "react";
// import SideComp from "./SideComp";
import "./AddData.css";
import moment from "moment";
import Navbar from "./Navbar/Navbar";

function AddData() {
  const [state, setState] = useState("");
  const [district, setDistrict] = useState("");
  const [taluka, setTaluka] = useState("");
  const [area, setArea] = useState("");
  const [soil,setSoil]=useState("")
  // const [crop, setCrop] = useState("");
  const [season, setSeason] = useState("");
  const [cultidate, setCultiDate] = useState("");
  const [yeilddate, setYeildDate] = useState("");
  const [village, setVillage] = useState("");
  const [crop, setCrop] = useState("");


   let distMaha=["nagar","pune","Beed"]
   let distKN=["kymbatur","pune","Beed"]

   let arr2=[]
   let arr =[

    {
      state1:"Maharashta",
      dist:["nagar","pune","Beed"]

    },
    {
      state1:"Karnatak",
      dist:["koyambatur","","Beed"]

    },

    {
      state1:"Gujarat",
      dist:["koyambatur","pune","Beed"]

    },
    {
      state1:"MadhyaPradesh",
      dist:["koyambatur","pune","Beed"]

    },
    {
      state1:"Utter Pradesh",
      dist:["koyambatur","pune","Beed"]

    }

    
       
   ]

 

  async function save() {
    const data = {
     state:state,
     district:district,
     taluka:taluka,
     area:area,
     soil:soil,
     season:season,
     cultidate:cultidate,
     yeild:yeilddate,
     village:village,
     crop:crop

    };
     console.log(data)
    const response = await axios.post("http://localhost:4500/savedata/", data);

    console.log(response.data);

    if (response.data === "sucess") {
      alert("project data saved sucessfully");
      window.location.reload();
    }
  }

  const [id, setId] = useState();
  const [status, setStatus] = useState("");

  async function updateStatus() {
    const data = {
      id: id,
      status: status,
    };

    console.log(data);
  }

  console.log(state)
  
  return (
    <>
    <Navbar/>
    <div className="create-project" style={{ display: "flex" }}>
      <div>
      <div className="part2">
        

        <div className="projectInfo">
          <div className="projectName">
            <div style={{ display: "flex" }}>
              <div>
                <input
                  type="text"
                  placeholder="Enter your project Theme"
                  onChange={(e) => setCrop(e.target.value)}
                />
              </div>
              <button onClick={save}>Save project</button>
            </div>
          </div>
          {/* 
      <div>
        <button onClick={save}>Save project</button>
      </div> */}

          <div className="selecttags1">
            {/* <label>reason</label>
            <label>type</label>
            <label>division</label> */}

           <div>
            <p>state</p>
           
            <input type="text" placeholder="Enter Your State"  onChange={(e) => setState(e.target.value)}/>
           </div>

            
             <div>
              <p>district</p>
             
              <input type="text" placeholder="Enter yout District " onChange={(e) => setDistrict(e.target.value)}/>
             </div>
            
           <div>
          
            <input type="text" placeholder="Enter your Taluka" onChange={(e) => setTaluka(e.target.value)} />
           </div>
          </div>

          <div className="selecttags2">
            
            
             <p>area</p>
            <input type="text" placeholder="enter crop area" />

           </div>

           <div>
            <p>soil</p>
           <select onChange={(e) => setSoil(e.target.value)}>
              <option>select soil type</option>
              <option>Snady</option>
              <option>clay</option>

              <option>slit</option>
              <option>loamy</option>

            </select>
           </div>
          <div>
              <p>season</p>
          <select onChange={(e) => setSeason(e.target.value)}>
              <option>select department</option>
              <option>Summer</option>
              <option>Winter</option>
              <option>Mansoon</option>
              
            </select>
          </div>
          </div>
          {/* <select onChange={(e)=>setStartDate(e.target.value)}>
        
        </select> */}
          <div className="selecttags3">
           
           <div>
            <p>cultivation date</p>
           <input
              type="date"
              placeholder="Enter Start Date"
              onChange={(e) => setCultiDate(e.target.value)}
            />
           </div>
           <div>
            <p>expected yeild date</p>
           <input
              type="date"
              placeholder="Enter End Date"
              onChange={(e) => setYeildDate(e.target.value)}
            />
           </div>
            <div>
            
            <input type="text" placeholder="Enter your Village" onChange={(e) => setVillage(e.target.value)}/>
            </div>
          </div>
          <p className="reg">Status:Registered</p>
        </div>
      </div>
      
    </div>
    </>
  );
}

export default AddData;
